import MealItem from './MealItem'
import { useEffect } from 'react';

const Meals = () => {
    const [meals, setMeals] = useState([]);

    useEffect(() => {
        fetch('http://localhost:3001/meals')
            .then(res => res.json())
            .then(data => {
                setMeals(data)
            })
            .catch(err => {
                console.error(err);
            });
    }, []);
    return (
        <ul id="meals">
            {meals.map(meal => (
                <MealItem key={meal.id} meal={meal} />
            ))}
        </ul>
    )
}

export default Meals
